import React from 'react';
import styled from 'styled-components';

function ResumeDetailBody() {
	return (
		<ComponentWrapper>
			<div className="ResumeDetail_ResumeDetail__body__basic__title__StGBM">
				<div>
					<input
						className="ResumeInput_ResumeInput__spGWu resume-input title basic"
						type="text"
						maxLength="100"
						placeholder="이력서 제목(필수)"
						name="title"
						value="이해찬"
					/>
				</div>
			</div>
			<div>
				<input
					className="ResumeInput_ResumeInput__spGWu resume-input name"
					type="text"
					maxLength="100"
					placeholder="이름(필수)"
					name="name"
					value="이해찬"
				/>
			</div>
			<div>
				<input
					class="ResumeInput_ResumeInput__spGWu resume-input email"
					type="email"
					maxlength="120"
					placeholder="이메일(필수)"
					name="email"
					value="cksgodl1@naver.com"
				/>
			</div>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	margin-bottom: 60px;
	input {
		-moz-appearance: none;
		-webkit-appearance: none;
		resize: none;
		border: none;
		outline: none;
	}
	.ResumeInput_ResumeInput__spGWu.name {
		margin-top: 20px;
		font-size: 16px;
		margin-bottom: 0;
	}
	.ResumeDetail_ResumeDetail__body__basic__title__StGBM {
		padding-top: 130px;
	}
	.ResumeInput_ResumeInput__spGWu.title.basic {
		color: #3b3d40;
		font-size: 36px;
		line-height: 36px;
		font-weight: 500;
		font-family: inherit;
		margin: 0 0 50px;
		white-space: pre-wrap;
		word-wrap: break-word;
		border: none;
		-webkit-appearance: none;
		resize: none;
		outline: none;
	}
`;

export default ResumeDetailBody;
